import React from 'react';
import s from './BottomFooter.module.css';

const ButtomFooter = () => {
    return (
        <div className={s.bottom_footer}>
            <p className={s.made}>Made with ❤️ by Tigran Kheranyan</p>
            <p className={s.theme}>Theme by <a href="#">TigranKheranyan-portflolio</a></p>
        </div>
    );
}

export default ButtomFooter;
